      <div className="lineunder">
        <img
          src="https://i.pinimg.com/564x/2a/83/18/2a8318f09b0d139371d5320f14d03c4f.jpg"
          alt=""
        ></img>
        <h1 className="h1header">Dorrah Alqwifel</h1>
        <h3 className="h3header">Full Stack Developer </h3>
      </div>

      <div className="lineunder">
        <i className="icon">
          <FaLocationArrow />
        </i>{" "}
        Qassim <br />
        <i className="icon">
          <FaRegEnvelopeOpen />
        </i>{" "}
     <div></div>
        <a className="aheader" href="mailto:dorrah.alqwifel.gmail.com"> dorrah.alqwifel.gmail.com</a>

      </div>

      <div className="lineunder">icon icon</div>

      <div className="lastdiv">
        I built this site with React components and a JSON Resume Schema. The
        full source code can be found in my Github repo.
      </div>
    </div>
  );
};

export default Inform;
